        int reversed = 0, original = i;

        int number = i;
        while (number != 0) {
            reversed = reversed * 10 + number % 10;
            number /= 10;
        }

        if (original == reversed) {
            if (original % 2 == 0) counts[0]++;
            else counts[1]++;
        }
    }

